import React from 'react';
import './index.css';
import rated from '../../rated.png';
import unrated from '../../unrated.png';

const Rate = ({questions,counter}) => {


        const getStarNumber = (x) => {
            if(x ==="easy"){
                console.log("This is Easy")
                return 1;
            }
            else if(x ==="medium"){
                console.log("This is the Medium");
                return 2;
            }
            else{
                console.log("This is the Hard and This is the Value of X",x);
                return 3;
            }
        }


        return (
            <div>
                    {console.log("This is the Returned Value",new Array(getStarNumber(questions[counter].difficulty)).fill(1))}

                    {new Array(getStarNumber(questions[counter].difficulty))
                    .fill(1).map(() =>   <img src={rated} alt="This is the Rated"/>)}
                    { new Array( 5 - getStarNumber(questions[counter].difficulty))
                    .fill(2).map(() => <img src={unrated} alt="This is the Unrated"/>)}
            </div>
        );
}
export default Rate;
